    "title": "NLSProblems - Nonlinear Least Squares problems",
    "category": "section",
    "text": "(Image: Build Status) (Image: Build status)This package provides some optimization problems using the https://github.com/JuliaSmoothOptimizers/NLPModels.jl interface. It is similar to to https://github.com/JuliaSmoothOptimizers/OptimizationProblems.jl, except that it\'s specific for Nonlinear Least Squares, using the subtype of AbstractNLSModels.This collection currently contains the problems of Moré, Garbow and Hillstrom [1].We welcome contributions."
